battleApp.controller('corpBattleController', [
        '$scope', 'userService', 'progressService', 'battleService',
function($scope, us, ps, bs){

    logit("Battle Controller top")

    $scope.run = false
    $scope.user = us.get_user()
    $scope.highest_level = ps.getHighestLevel()
    $scope.totalStars = ps.getTotalStars()
    // TODO: figure out where to make the calculation for coins and pass to user
    // don't do the calc for level 0!
    $scope.progress = ps.lookupLevel($scope.highest_level) // this info is bound to the service variable
    $scope.battle_vis_state_controller = "NONE" // NONE, VIS, EVERGREEN 
    $scope.battle_grow_state_controller = "STATIC" // STATIC, GROW 
    $scope.slides = [
        {title:"Cryptolocker holds computer files hostage", slug: "cryptolocker-holds-computer-files-hostage", image: "http://placecage.com/g/135/76"},
        {title:"Data breach", slug: "data-breach", image: "http://fillmurray.com/g/135/76"},
        {title:"DDOS", slug: "ddos", image: "http://placekitten.com/g/135/76"},
        {title:"Malware", slug: "malware", image: "http://fillmurray.com/g/135/76"},
    ]
    $scope.slide_index = $scope.highest_level;
    $scope.slide_direction = 'left';


  
    bs.lookupLevel( $scope.highest_level ).success(function(data){
        $scope.levels = data
        $scope.battle = bs.initBattle($scope.levels.cards.length, $scope.levels.coins_per_card)
        $scope.coinsleft = $scope.battle.coin.earned()
        $scope.run = true
        // set up extra level data to handle user and coin results
        var i, nCards=$scope.levels.cards.length
        for (i = 0; i < nCards; i++) {
            $scope.levels.cards[i].users_lost = 0
            $scope.levels.cards[i].coins = 0
        }

    })

    $scope.slideAdvance = function (iDir) {
        logit("advance the slider by " + iDir)

        if ( iDir < 0 ) {
            //prev
            $scope.slide_index = ($scope.slide_index > 0) ? --$scope.slide_index : $scope.slide_index 
            $scope.slide_direction = 'right';
        } else {
            //next (use the highest level; dom elements for higher level panels exist but we never want to see them for this level)
            $scope.slide_index = ($scope.slide_index < $scope.highest_level) ? ++$scope.slide_index : $scope.slide_index           
            $scope.slide_direction = 'left';
        }
        logit("slideAdvance, $scope.slide_index = " + $scope.slide_index)
   
    }

    $scope.setCurrentSlideIndex = function (index) {
        logit("The setCurrentSlideIndex index = " + index)
        $scope.slide_index = index;
    };

    $scope.isCurrentSlideIndex = function (index) {
        return $scope.slide_index === index;
    };

    $scope.toggle_panel = function(panel) {
        $scope.battle.panels[panel] = !$scope.battle.panels[panel]
    }

    $scope.reset_chooser = function() {
        logit('reset (clear) the chooser')
        $scope.battle = bs.initBattle($scope.levels.cards.length, $scope.levels.coins_per_card)
        $scope.coinsleft = $scope.battle.coin.earned()
    }

    $scope.select_coin = function(iDefense, iSpot) {
        var inc = $scope.battle.coin.spots[iDefense][iSpot] ? 1: -1
        logit("You selected the " + iSpot + " spot of the  " + iDefense + "th defense, and inc = " + inc )
        $scope.coinsleft += inc
        if ($scope.coinsleft < 0) {
            $scope.coinsleft = 0
            return
        } 
        $scope.battle.coin.spots[iDefense][iSpot] = !$scope.battle.coin.spots[iDefense][iSpot]
    }

    $scope.battle_vis = function() {

        // set the vis state here
        $scope.battle_vis_state_controller = "VIS"

        // the directive watches for the var
        // --> vis runs
        // the directive calls a function here (or set var and we watch it, if dat dont vork)
        // --> call battle_results()
    }

    $scope.battle_results = function() {

        ps.completeBattle() // up the progress
        $scope.battle.users_lost = 0

        var i, j, nRatioLost
        for (i = 0; i < $scope.levels.cards.length; i++) {
            for (j = 0; j < $scope.levels.coins_per_card; j++) {
                if ( !$scope.battle.coin.spots[i][j] ) {
                    //logit("Found a card spot that was not filled in, " + i + " " + j)
                    $scope.battle.users_lost += $scope.levels.cards[i].points / 2
                    $scope.levels.cards[i].users_lost += $scope.levels.cards[i].points / 2
                    //logit(" $scope.levels.cards[i].users_lost: " +  $scope.levels.cards[i].users_lost)
                } else {
                    $scope.levels.cards[i].coins++
                    //logit(" $scope.levels.cards[i].coins " +  $scope.levels.cards[i].coins)
                }
            }
        }

        // TODO: not sure if we even need this calculation! Is $scope.result_word used?

        nRatioLost = $scope.battle.users_lost / $scope.user.users

        if (nRatioLost < .3 ) {
            logit("GOOD")
            $scope.result_word = "GOOD"
        } else if (nRatioLost < .6) {
            logit("OK")
            $scope.result_word = "OK"
        } else {
            logit("BAD")
            $scope.result_word = "BAD"
        }

        bs.getBattleResults() // command to process user loss
    }

}])

battleApp.animation('.slide-animation', function() {
    return {
        addClass: function(element, classname, done) {
            var scope = element.scope(),
                duration = 500
            if (classname == 'ng-hide') {
                // do the out anim
                
                var finishPoint = element.parent().width();
                if (scope.slide_direction !== 'left') {
                    finishPoint = -finishPoint;
                }
                logit('do the out anim, finishPoint = ' + finishPoint)
                //TweenMax.to(element, 0.5, {left: finishPoint, onComplete: done });

                element.animate({'left':finishPoint }, duration, function() {done()}) 

            } else {
                done()
            }
        }, removeClass: function (element, classname, done) {
            var scope = element.scope(),
                duration = 500
            if (classname == 'ng-hide') {
                element.removeClass('ng-hide')
                logit('do the in anim' + element.name)
                // do the in anim
                var startPoint = element.parent().width();
                if(scope.slide_direction === 'right') {
                    startPoint = -startPoint;
                }

                element.css({'left':startPoint })
                element.animate({'left':0 }, duration, function() {done()}) 

                //TweenMax.set(element, { left: startPoint });
                //TweenMax.to(element, 0.5, {left: 0, onComplete: done });
            } else {
                done()
            }
        }
    }
    // animation code adapted from: http://onehungrymind.com/build-sweet-photo-slider-angularjs-animate/
})

