battleApp.factory('battleService', [
        'userService', '$http', 
function(us, $http){

    var battle = {
        coin : {
            spots : [],
            earned : function() {return us.get_user().coins},
        },
        panels : [],
        users_lost : 0,
        result_word : ""
    }

    function lookupLevel(level){
        // TODO: remove the parameter from the request, it is there just to break cache on local
        var promise = $http.get('research/ajax/level_data/' + level + "/?=9") 
        return promise
    }

    return {

        lookupLevel: lookupLevel,
        initBattle: function(nCards, nCoinsPerCard) {

            logit("initBattle")

            // set up the data to keep track of ui panels and coin states
            var i, j, aPanels=[], aCoinSpots=[]
            for (i = 0; i < nCards; i++) {
              aPanels[i] = false
              var aCoinSpotsInner=[]
              for (j = 0; j < nCoinsPerCard; j++) {
                aCoinSpotsInner.push(false)
              }
              aCoinSpots.push(aCoinSpotsInner)

            }
            battle.panels = aPanels
            battle.coin.spots = aCoinSpots

            return battle
            
        },
        getBattleResults: function() {

            logit("getBattleResults")

            // TODO: below is not meant to be the final calculation for the users lost
            //battle.users_lost = ( 6 - battle.coin.earned() ) / 6 * eval( us.get_user().cur_level + 2 ) * us.get_user().users
            us.set_users(us.get_user().users - battle.users_lost)

        },
        get_battle: function() {
            return battle
        }
    }
}])

