glossaryApp.directive('cyberStory', [ 
        '$compile', '$templateCache',
function($compile, $templateCache){
    return {
        templateUrl: 'research/story_templates/',
        scope: {
            id: '=cyberStory'
        },
        transclude: true,
        restrict: 'A',
        link: function(scope, ele){
            function recomp(){
                ele.html(
                    '<div class="cyber-story-wrapper">'
                    + '<div class="cyber-story-popup">'
                    +  '<div class="cyber-story-topbar">'
                    +   '<div ng-click="$parent.showCyberStory=false"></div>'
                    +  '</div>'
                    +  '<div class="cyber-story-main">'
                    +   $templateCache.get(scope.id)
                    +  '</div>'
                    + '</div>'
                    +'</div>'
                )
                $compile(ele.contents())(scope)
            }
            recomp()
            scope.$watch('id', function(newVal, oldVal){
                if (newVal != oldVal) recomp()
            })
        }
    }
}])

