                $scope.puzzle_data.solution =  $scope.puzzle_data.solution[Math.floor(Math.random()*$scope.puzzle_data.solution.length)]; // gets a random entry from the array of choices
                $scope.puzzle_state.cracked.computer = 
                ($scope.puzzle_state.crackattempt.uppercase 
                    && $scope.puzzle_state.crackattempt.brute_index.value >= $scope.puzzle_data.brute_min_attack_index) 
                || $scope.puzzle_state.crackattempt.random_guess1 == $scope.puzzle_data.solution
